contracts/VotingDao.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

contract VotingDao {
    using EnumerableSet for EnumerableSet.UintSet;

    // Struct for Proposal
    struct Proposal {
        uint256 id;
        string description;
        uint256 expirationTime;
        uint256 votesFor;
        uint256 votesAgainst;
        bool active;
    }

    // Proposal ID counter
    uint256 private _proposalIdCounter;

    // Mapping for storing proposals
    mapping(uint256 => Proposal) private proposals;

    // Mapping to track if a user has voted on a specific proposal
    mapping(uint256 => mapping(address => bool)) private hasVoted;

    // Set to store all proposal IDs
    EnumerableSet.UintSet private proposalIds;

    // Events
    event ProposalCreated(uint256 indexed proposalId, address indexed creator, string description, uint256 expirationTime);
    event VoteCast(address indexed voter, uint256 indexed proposalId, bool voteFor);

    // Create a new proposal (any user can create)
    function createProposal(string calldata description, uint256 durationInSeconds) external {
        require(durationInSeconds > 0, "Invalid expiration time");

        _proposalIdCounter++; // Increment proposal ID counter
        uint256 newProposalId = _proposalIdCounter;

        proposals[newProposalId] = Proposal({
            id: newProposalId,
            description: description,
            expirationTime: block.timestamp + durationInSeconds,
            votesFor: 0,
            votesAgainst: 0,
            active: true
        });

        proposalIds.add(newProposalId);

        emit ProposalCreated(newProposalId, msg.sender, description, proposals[newProposalId].expirationTime);
    }

    // Vote on a proposal (true = for, false = against)
    function vote(uint256 proposalId, bool voteFor) external {
        Proposal storage proposal = proposals[proposalId];

        require(proposal.active, "Proposal is not active");
        require(block.timestamp <= proposal.expirationTime, "Voting period has expired");
        require(!hasVoted[proposalId][msg.sender], "Already voted");

        // Mark the user as having voted
        hasVoted[proposalId][msg.sender] = true;

        // Update vote counts based on the user's vote
        if (voteFor) {
            proposal.votesFor++;
        } else {
            proposal.votesAgainst++;
        }

        emit VoteCast(msg.sender, proposalId, voteFor);
    }

    // Check if a proposal is active or closed based on expiration time
    function isProposalActive(uint256 proposalId) public view returns (bool) {
        Proposal storage proposal = proposals[proposalId];
        return proposal.active && block.timestamp <= proposal.expirationTime;
    }

    // Get vote counts for a proposal
    function getVoteCount(uint256 proposalId) public view returns (uint256 votesFor, uint256 votesAgainst) {
        Proposal storage proposal = proposals[proposalId];
        return (proposal.votesFor, proposal.votesAgainst);
    }

    // Retrieve proposal details by ID
    function getProposal(uint256 proposalId) public view returns (Proposal memory) {
        return proposals[proposalId];
    }

    // Retrieve all proposal IDs
    function getAllProposalIds() public view returns (uint256[] memory) {
        return proposalIds.values();
    }

    // Check if a user has voted on a specific proposal
    function hasUserVoted(uint256 proposalId, address user) public view returns (bool) {
        return hasVoted[proposalId][user];
    }
}

